import React from "react";
import { Container } from "react-bootstrap";
import Row from "react-bootstrap/Row";
import Tab from "react-bootstrap/Tab";
import Tabs from "react-bootstrap/Tabs";
import { useScrollPosition } from "../../hooks/useScrollPosition";
import { Jumbotron } from "./migration";

const Skills = React.forwardRef(({ heading }, ref) => {
  const skillsTabRef = React.useRef(null);
  const [isScrolled, setIsScrolled] = React.useState(false);

  useScrollPosition(
    ({ prevPos, currPos }) => {
      if (!isScrolled && currPos.y - 400 < 0) setIsScrolled(true);
    },
    [],
    skillsTabRef
  );

  return (
    <Jumbotron ref={skillsTabRef} fluid className="bg-white m-0" id="skills">
      <Container className="p-5 ">
        <h2 ref={skillsTabRef} className="display-4 pb-5 text-center hao">
          {heading}
        </h2>
        <Tabs
          className="skills-tabs"
          defaultActiveKey="project-hub"
          id="skills-tabs"
          fill
        >
          <Tab
            tabClassName="skills-tab lead"
            eventKey="project-hub"
          >
            <Row className="pt-3 px-1">
              <p>
                We are the leading professional project maker that offers projects for college students. We provide working projects, readymade projects, readymade dissertation and thesis for the students of MBA, BBA, MCA, BCA, B. Tech, Law, Pharmacy, IT, Hospital, Travel and many more...
                <br />
                <br />
                As per university standard
                <br />
                100% tested and approved Project
                <br />
                1000+ Projects Available
                <br />
                Varied Specializations
                <br />
                SCDL, SMU, VTU, JNU, AMITY, AKTU, NIMIMS Etc.
                <br />
                Full Project = Synopsis + Report + PPT
                <br />
                Delivery to your inbox
                <br />
                Cost Effective
              </p>
            </Row>
          </Tab>
        </Tabs>
      </Container>
    </Jumbotron>
  );
});

export default Skills;
